import styled from 'styled-components'

export const AstronomyCardWrapper = styled.div`
    text-align: center;
    .AstronomyCardWrapper__image-container {
        display: block;
        width: 80%;
        margin: auto;
        img {
            width: 100%;
        }
        iframe {
            max-width:100%;
        }
    }
`
